(156, '新东方在线', 'xindongfangzaixian', '', 'http://www.koolearn.com/', 'http://www.chanet.com.cn/image/promotion/163833', 18, '21%', '新东方在线（www.koolearn.com）是国内最著名的私立综合教育机构、美国纽约证交所上市公司——新东方教育科技集团（NYSE:EDU）旗下专业的在线教育网站。自2000年上线以来，经过十年的发展，新东方在线已经成为中国最强大的网络教育服务平台和最领先的外语培训类网络教育品牌。', '新东方在线（<a href=\"http://www.koolearn.com\">www.koolearn.com</a>）是国内最著名的私立综合教育机构、美国纽约证交所上市公司——新东方教育科技集团（NYSE:EDU）旗下专业的在线教育网站。自2000年上线以来，经过十年的发展，新东方在线已经成为中国最强大的网络教育服务平台和最领先的外语培训类网络教育品牌。新东方在线的网络课程服务横跨留学考试、学历考试、职业教育、英语充电、多种语言、中学教育等6大类60余小类，共计1200多门课程，为各类用户提供全面的在线教育服务，截止至2011年12月，新东方在线网站个人注册用户已逾900万，移动学习用户超过160万。2008年，新东方在线作为唯一的综合网络培训机构入选中国互联网协会正式公布的首批 \"绿色网络文化产品\" 名单。', 1344266748, 0, '', 1, 1451404800, 1, '', '', '', 0, 0, 2388, 283064, '', NULL, 0, NULL, 1, 0, 0.00, 0, '货到付款：有 正规发票：有 运费政策：购满XX免'),
